description:
Lt. Frank Drebbin returns to save the day once again. This time he's out to foil the &quot;big boys&quot; in the energy business. A top scientist (Dr Mainheimer) is about to publish his report on energy supply for the future. Things don't look good for the traditional suppliers; oil, coal and nuclear. To save their industries, the suppliers kidnap Mainheimer and replace him with a decoy with a more favourable report. Jane, the Dr's secretary, is Drebbin's old flame; they're passionate love affair is thus rekindled. 
